<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Document</title>
    <style>
      * {
        margin: 0;
        box-sizing: border-box;
      }

      body {
        font-family: sans-serif;
        background-color: #fff;
      }

      .container1 {
        background-color: gray;
        margin: 80px auto;
        width: 90%;
        height: 500px;
        max-width: 500px;

        display: grid;
        grid-template-columns: repeat(3, 1fr);
        grid-template-rows: repeat(3, 1fr);
      }

      .container2 {
        background-color: lightgrey;
        margin: 80px auto;
        width: 90%;
        height: 500px;
        max-width: 500px;

        display: grid;
        grid-template-columns: repeat(4, 1fr);
        grid-template-rows: repeat(3, 1fr);
      }

      .ele {
        color: #eee;
        text-align: center;
        font-size: 1.5rem;
        font-weight: bold;
      }

      .ele img{
        width: 100%;
        height: 100%;
        object-fit: cover;
        gap: 50px;
      }

      .c1 {
        background-color: seagreen;
        grid-column: 1/2;
        grid-row: 1/2;
      }

      .c2 {
        background-color: deeppink;
        grid-column: 2/3;
        grid-row: 1/3;
      }

      .c3 {
        background-color: indigo;
        grid-column: 3/4;
        grid-row: 1/2;
      }

      .c4 {
        background-color: royalblue;
        grid-column: 1/2;
        grid-row: 2/3;
      }
      .c5 {
        background-color: yellow;
        grid-column: 3/4;
        grid-row: 2/3;
      }

      .c6 {
        background-color: cyan;
        grid-column: 1/3;
        grid-row: 3/4;
      }

      .c7 {
        background-color: magenta;
        grid-column: 3/4;
        grid-row: 3/4;
      }

      .c8 {
        background-color: royalblue;
        grid-column: 1/3;
        grid-row: 1/3;
      }

      .c9 {
        background-color: red;
        grid-column: 3/4;
        grid-row: 1/2;
      }

      .c10 {
        background-color: chartreuse;
        grid-column: 4/5;
        grid-row: 1/2;
      }

      .c11 {
        background-color: rgb(65, 225, 73);
        grid-column: 1/2;
        grid-row: 3/4;
      }

      .c12 {
        background-color: rgb(225, 65, 225);
        grid-column: 2/3;
        grid-row: 3/4;
      }

      .c13 {
        background-color: rgb(214, 225, 65);
        grid-column: 3/5;
        grid-row: 2/4;
      }
    </style>
  </head>
